    false,nt"url": null,nt"notes": "Observations obtained during the August
    6th - 7th field surveys are part of the continuing assessment of the fate and effects
    of spilled Prudhoe crude upon the Atigun Flood Plain system. The continuing field
    assessments are performed as per the intents of Phase III and IV of the National
    and Regional Pollution Response Contingency Plans. The June 19-20 and 26-28, 1979
    field assessment survey showed that a large amount of oil had become entrapped within
    the flood plain sediments and root masses of riparian vegetation. The August field
    survey was aimed at: (1) determining the extent of the flood plain still affected
    by "stored" oil; (2) determining the level of threat the "stored" oil could
    still pose or could continue to pose to the habitat/fish and wildlife resources
    of the Atigun Flood Plain; and (3) determining if continuation or modification of
    spill containments and clean-up activities were still mandated.",nt"owner_org":
